import { AuthProvider, useAuth } from 'react-oidc-context'
import './styles.css'

const oidcConfig = {
  authority: 'https://localhost:10001/',
  client_id: 'Onebill_App',
  redirect_uri: 'https://localhost:4200',
  response_type: 'code',
  filterProtocolClaims: true,
  loadUserInfo: true,
  metadata: {
    authorization_endpoint: `https://localhost:10001/connect/authorize`,
    token_endpoint: `https://localhost:10001/connect/token`,
  },
  post_logout_redirect_uri: 'https://localhost:4200',
  scope: 'AdministrationService IdentityService BillingService TenantService',
}

function LoginButton() {
  const auth = useAuth()

  return <button onClick={() => void auth.signinRedirect()}>Log in</button>
}

function UserInfo() {
  const auth = useAuth()

  if (!auth || !auth.userData) {
    return null
  }

  return (
    <div>
      <h3>User Info:</h3>
      <p>Name: {auth.userData.profile.name}</p>
      <p>Email: {auth.userData.profile.email}</p>
    </div>
  )
}

export default function App() {
  return (
    <div className='App'>
      <h1>Welcome to My App</h1>
      <LoginButton />
      <UserInfo />
    </div>
  )
}
